import React, {Component} from 'react';
import Container from 'react-bootstrap/Container';
import {useSpring, animated} from 'react-spring';
import {Spring} from 'react-spring/renderprops';

import { Icon } from 'antd';

import '../Styles/Home.css';
import ProjectCard from './ProjectCard';








class Home extends Component {
render () {
  return(






 <Container className="homeContainer" fluid >
  <Container>
  <link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Open+Sans|Rancho|Permanent+Marker&display=swap" rel="stylesheet"></link>
  <h1 className="homeText"> I am <span>Karishma</span> , </h1>
    <h5 className="homeText"> a Front-End Developer based in New York</h5>


    <Spring
  from={{ opacity: 0 , color: 'pink' , transition: '300ms'}}

  to={{ opacity:  6, color: 'green' , transition: '300ms'}}>
  {props => <div style={props}>hello</div>}
</Spring>


  </Container>

  <Container className="text">
    <h5 className="homeText"> Projects</h5>
    <Icon  type="down-circle" />
  </Container>
  <ProjectCard/>





</Container> 


)
}
}

export default Home;
